import React from 'react';
import Header from './../../components/header/Header.js';
import Footer from './../../components/footer/Footer.js';
import './Creator.css'

const Creator = () => {
  return (
    <div>
      <Header />
      <h1>Creator Page</h1>
      {/* Page content goes here */}
      <Footer />
    </div>
  );
};

export default Creator;
